import React, { Component } from 'react'
import hello from './index.module.css'
export default class Hello extends Component {
    state
    render() {
        return (
            <div>
                <div className="hello.helloClass">
                    hello
                </div>
                <input type="text" placeholder="点我提示数据"/>
                <button onClick={this.btn}>点我提示左侧的数据</button>
                <input type="text" placeholder="失去焦点提示数据"/>
            </div>

        )
    }
    btn=()=>{
        console.log(this)
    }
}
